script: |
  super -f text -I q6530.spq | sort > q6530.out

inputs:
  - name: q6530.spq
    data: |
      SELECT DISTINCT - cor0.col0 AS col1 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet), tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q6530.out
    data: |
      -3
      -64
      -80
